<div class="box-body">
    <ol style="text-align:justify;">
        <li>Pada halaman home page silahkan pilih “Sinkronisasi CSI kemudian pilih Penjadwalan”.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Pada halaman Sinkronisasi CSI ini pengguna harus merubah Status menjadi AKTIF, kemudian pengguna memilih Periode HARIAN, dan memilih Tanggal. Pada periode HARIAN ini sinkronisasi akan dilakukan pada pukul 24:00 malam hari, dan untuk periode HARIAN ini bisa dilakukan sehari atau lebih dari satu hari.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Jika semua sudah diatur sesuai dengan waktu penjadwalan sinkronisasi CSI yang sudah ditentukan kemudian pengguna menekan tombol “Simpan” dan akan muncul pop-up konfirmasi kemudian tekan tombol “Yes”.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Penjadwalan HARIAN berhasil dilakukan, maka sinkronisasi CSI akan dilakukan sesuai dengan Tanggal yang sudah ditetapkan.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
